INSERT INTO `field_data_body` (`entity_type`, `bundle`, `deleted`, `entity_id`, `revision_id`, `language`, `delta`, `body_value`, `body_summary`, `body_format`) VALUES
('node', 'estacion_del_metro', 0, 1, 1, 'und', 0, 'Nezahualcóyotl is a station on Line B of the Mexico City Metro system.[1][2] It is located in Ciudad Nezahualcóyotl in the State of Mexico adjacent to Mexico City.[1]\r\n\r\nThe logo for the station is the head of a coyote since Nezahualcóyotl is Nahuatl for \"hungry coyote\", it is similar to the seal of Ciudad Nezahualcóyotl.[1][2] The station was opened on 30 November 2000.[3]\r\n\r\nFrom 2000 to 2002 the station name was Continentes (Spanish for \"continents\"), due to the station being near the Boulevard de los Continentes, and the icon of the station was a Mollweide projection. In 2002, it was decided to change the name of the station to Nezahualcóyotl, to reflect the name of the municipality that is crossed by this specific station.[4]\r\n\r\nExits\r\nNorth: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe\r\nNortheast: Av. Central and Boulevard de los Continentes, Col. Vergel de Guadalupe\r\nSouth: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe\r\nSoutheast: Av. Central and Av. Jorge Jiménez Cantú, Col. Vergel de Guadalupe\r\nReferences\r\n \"Nezahualcóyotl\" (in Spanish). Archived from the original on 27 April 2011. Retrieved 5 August 2011.\r\n Archambault, Richard. \"Nezahualcóyotl » Mexico City Metro System\". Retrieved 5 August 2011.\r\n Monroy, Marco. Schwandl, Robert (ed.). \"Opening Dates for Mexico City\'s Subway\". Retrieved 5 August 2011.\r\n \"¿Por qué algunas estaciones del Metro cambiaron de nombre?\". El Universal (in Spanish). July 14, 2017. Retrieved August 21, 2018.\r\nhttps://www.eluniversal.com.mx/entrada-de-opinion/colaboracion/mochilazo-en-el-tiempo/nacion/sociedad/2017/07/14/por-que-algunas', '', 'full_html'),
('node', 'estacion_del_metro', 0, 2, 2, 'und', 0, 'San Lázaro is a station on the Mexico City Metro. It is located in the Venustiano Carranza borough of Mexico City. It lies along Lines 1 and B. The station was opened on 5 September 1969.[1] The station was designed by Félix Candela[2] and consists of interlocked hyperbolic paraboloidal or saddle roof sections.\r\n\r\n\r\nContents\r\n1	General information\r\n2	Nearby\r\n3	Exits\r\n3.1	Line 1\r\n3.2	Line B\r\n4	References\r\n5	External links\r\nGeneral information\r\nThe station logo depicts an old steam locomotive. Near the site of the metro station stood the San Lázaro mainline train station. San Lázaro was the main terminus for the Interoceanic Railway, which linked the port of Veracruz, on the Gulf of Mexico, with the Pacific Ocean. Today, some railway tracks can still be seen near the metro station, but nothing more.\r\n\r\nNearby is the building that houses the Chamber of Deputies (\"Palacio Legislativo\" in Spanish), the lower house of the Mexican Congress (Congreso de la Unión).\r\n\r\nSan Lázaro metro station is connected with TAPO, Mexico City\'s Eastern intercity bus station.[3] This bus station serves states including Puebla, Veracruz, Oaxaca, and Yucatán. It is used by some of the most prestigious and safest bus lines in Mexico, such as ADO, UNO, and Maya de Oro.\r\n\r\nNearby\r\nTerminal de Autobuses de Pasajeros de Oriente, bus terminal.\r\nPalacio Legislativo de San Lázaro, main seat of the legislative power of the Mexican government.\r\nArchivo General de la Nación, General Archive of the Nation.\r\nPalacio de Lecumberri, former prison, now housing the Archivo General de la Nación.\r\nExits\r\nLine 1\r\nSouthwest: Avenida Zaragoza and Eje 3 Oriente Ing. Eduardo Molina, Colonia 10 de mayo\r\nSoutheast: Terminal de Autobuses de Pasajeros de Oriente, Colonia 10 de mayo\r\nLine B\r\nAvenida Ing. Eduardo Molina, Colonia 7 de julio\r\nReferences\r\n Monroy, Marco. Schwandl, Robert (ed.). \"Opening Dates for Mexico City\'s Subway\". Retrieved 11 August 2011.\r\n \"Felix Candela (1910-1997)\". Structurae. Retrieved 11 August 2011.\r\n \"Eastern intercity bus station\". Archived from the original on 8 August 2011. Retrieved 6 August 2011.\r\nExternal links\r\n Media related to San Lázaro (station) at Wikimedia Commons', '', 'filtered_html'),
('node', 'estacion_del_metro', 0, 3, 3, 'und', 0, 'Test Universal', '', 'filtered_html');
