INSERT INTO `search_dataset` (`sid`, `type`, `data`, `reindex`) VALUES
(1, 'node', ' metro nezahualcóyotl nezahualcóyotl is a station on line b of the mexico city metro system 12 it is located in ciudad nezahualcóyotl in the state of mexico adjacent to mexico city 1 the logo for the station is the head of a coyote since nezahualcóyotl is nahuatl for hungry coyote it is similar to the seal of ciudad nezahualcóyotl 12 the station was opened on 30 november 20003 from 2000 to 2002 the station name was continentes spanish for continents due to the station being near the boulevard de los continentes and the icon of the station was a mollweide projection in 2002 it was decided to change the name of the station to nezahualcóyotl to reflect the name of the municipality that is crossed by this specific station 4 exits north av central and boulevard de los continentes col vergel de guadalupe northeast av central and boulevard de los continentes col vergel de guadalupe south av central and av jorge jiménez cantú col vergel de guadalupe southeast av central and av jorge jiménez cantú col vergel de guadalupe references nezahualcóyotl in spanish archived from the original on 27 april 2011 retrieved 5 august 2011 archambault richard nezahualcóyotl mexico city metro system retrieved 5 august 2011 monroy marco schwandl robert ed opening dates for mexico city s subway retrieved 5 august 2011 por qué algunas estaciones del metro cambiaron de nombre el universal in spanish july 14 2017 retrieved august 21 2018 https wwweluniversalcommx entradadeopinion colaboracion mochilazo  gustavo a madero ', 0),
(2, 'node', ' metro san lázaro san lázaro is a station on the mexico city metro it is located in the venustiano carranza borough of mexico city it lies along lines 1 and b the station was opened on 5 september 19691 the station was designed by félix candela 2 and consists of interlocked hyperbolic paraboloidal or saddle roof sections contents 1 general information 2 nearby 3 exits 31 line 1 32 line b 4 references 5 external links general information the station logo depicts an old steam locomotive near the site of the metro station stood the san lázaro mainline train station san lázaro was the main terminus for the interoceanic railway which linked the port of veracruz on the gulf of mexico with the pacific ocean today some railway tracks can still be seen near the metro station but nothing more nearby is the building that houses the chamber of deputies palacio legislativo in spanish the lower house of the mexican congress congreso de la unión san lázaro metro station is connected with tapo mexico city s eastern intercity bus station 3 this bus station serves states including puebla veracruz oaxaca and yucatán it is used by some of the most prestigious and safest bus lines in mexico such as ado uno and maya de oro nearby terminal de autobuses de pasajeros de oriente bus terminal palacio legislativo de san lázaro main seat of the legislative power of the mexican government archivo general de la nación general archive of the nation palacio de lecumberri former prison now housing the archivo general de la nación exits line 1 southwest avenida zaragoza and eje 3 oriente ing eduardo molina colonia 10 de mayo southeast terminal de autobuses de pasajeros de oriente colonia 10 de mayo line b avenida ing eduardo molina colonia 7 de julio references monroy marco schwandl robert ed opening dates for mexico city s subway retrieved 11 august 2011 felix candela 19101997 structurae retrieved 11 august 2011 eastern intercity bus station archived from the original on 8 august 2011 retrieved 6 august 2011 external links media related to san lázaro station at wikimedia commons venustiano carranza ', 0),
(3, 'node', ' test test universal azcapotzalco ', 1581194386);
